import React from "react";

function Favorited({ formData }) {
  const containerStyle = {
    display: "flex",
    alignItems: "center",
    marginBottom: "10px", // Add spacing between each Favorited component
  };

  const avatarStyle = {
    width: "50px",
    border: "2px solid grey",
    borderRadius: "50%",
  };

  const h3Style = {
    fontSize: "12px",
    margin: "0", // Remove default margin for h3 elements
  };

  return (
    <div style={containerStyle}>
      <img src={formData.profile} alt="avatar" style={avatarStyle} />
      <div style={{ marginLeft: "10px" }}>
        <h3 style={h3Style}>{formData.username}</h3>
        <h3 style={h3Style}>{formData.location}</h3>
        <h3 style={h3Style}>{formData.age}</h3>
        {/* <h3 style={h3Style}>{FormData.timestamp}</h3> */}
      </div>
    </div>
  );
}

export default Favorited;
